import React from 'react';
import {Add,Sub,mult,div} from './Calc';
import Card from "./Card";
import Ndata from "./Ndata";

const i = Ndata[0];



function App(){
return(
    <>
    <div className = "main_box">
        
        <div className = "leftDiv">
        <h1 className = "heading">Netflix Series</h1>
            <Card 
                imgscr ={Ndata[0].imgscr} 
                title = {Ndata[0].title} 
                sname = {Ndata[0].sname} 
                link = {Ndata[0].link}                 
             />

            <Card 
                imgscr ={Ndata[1].imgscr} 
                title = {Ndata[1].title} 
                sname = {Ndata[1].sname} 
                link = {Ndata[1].link}                 
             />

            <card
                imgscr ={Ndata[2].imgscr} 
                title = {Ndata[2].title} 
                sname = {Ndata[2].sname} 
                link = {Ndata[2].link}                 
             />

            <Card 
                imgscr ={Ndata[3].imgscr} 
                title = {Ndata[3].title} 
                sname = {Ndata[3].sname} 
                link = {Ndata[3].link}                 
             />
            
                        
        </div>
        <div className = "rightDiv"> 
        <h1 className = "heading">Calculate Amount</h1>           
            <h2>Add : {Add(60,4)}</h2>
            <h2>sub : {Sub(60,4)}</h2>
            <h2>mult : {mult(60,4)}</h2>
            <h2>div: {div(60,3.5)}</h2>
        </div>
    </div>
    </>
);
}

export default App;
